import React, { useEffect, useState } from "react";
import axios from "axios";
const Main = () => {
  useEffect(() => {
    axios("https://api.spotify.com/v1/albums", {
      headers: {
        "Accept": "application/json",
        "Content-Type": "application/json",
        "Authorization": "Bearer ",
      },
      method: "GET"
    });
  }, []);

  return <div>Main</div>;
};

export default Main;
